import PortfolioItem from '../components/PortfolioItem';

const items = [
  {
    title: 'Grand Rajasthan Celebration',
    summary: 'A palatial destination wedding with 500+ guests and royal themed decor.',
    location: 'Jaipur, Rajasthan',
    date: 'Jan 2025',
    image: '/images/rajasthan1.jpg',
  },
  {
    title: 'Tech Brand Launch in Mumbai',
    summary: 'High-energy product launch with influencer guests and immersive stage design.',
    location: 'Mumbai, Maharashtra',
    date: 'Sep 2024',
    image: '/images/mumbai1.jpg',
  },
];

export default function Portfolio() {
  return (
    <div className="page-wrapper max-w-6xl mx-auto px-4 py-10">
      <h1 className="text-3xl md:text-4xl font-bold text-pink-700 text-center mb-8">
        Portfolio / Case Studies
      </h1>
      <div className="grid gap-6 md:grid-cols-2">
        {items.map((item) => (
          <PortfolioItem
            key={item.title}
            {...item}
            onClick={() => console.log('Open details for', item.title)}
          />
        ))}
      </div>
    </div>
  );
}
